/*Table structure for table `website_tb_article` */

DROP TABLE IF EXISTS `website_tb_article`;

CREATE TABLE `website_tb_article` (
  `CREATE_BY` varchar(500) NOT NULL COMMENT '记录的添加/修改人（系统用户表中用户编号）。',
  `CREATE_DATE` datetime NOT NULL COMMENT '系统时间。',
  `UPDATE_BY` decimal(15,0) NOT NULL COMMENT '记录的添加/修改人（系统用户表中用户编号）。',
  `UPDATE_DATE` datetime DEFAULT NULL COMMENT '系统时间。',
  `DEL_FLAG` decimal(1,0) NOT NULL COMMENT '0：表示存在，1：表示删除',
  `ID` varchar(64) NOT NULL,
  `ARTICLE_TITLE` varchar(500) NOT NULL COMMENT '文章标题',
  `ARTICLE_AUTHOR` varchar(500) DEFAULT NULL COMMENT '文章作者',
  `ARTICLE_CONTENT` varchar(255) NOT NULL COMMENT '文章内容',
  `ARTICLE_DEPT` varchar(200) DEFAULT NULL COMMENT '发布机构',
  `ARTICLE_EDIT` varchar(200) DEFAULT NULL COMMENT '责任编辑',
  `ARTICLE_KEY` varchar(200) DEFAULT NULL COMMENT '文章关键词',
  `ARTICLE_TAC` varchar(200) DEFAULT NULL COMMENT '文章敏感词',
  `ARTICLE_TACSIGN` decimal(1,0) DEFAULT NULL COMMENT '是否敏感文章 0：不是敏感文章；1：是敏感文章',
  `ARTICLE_ACT_URL` varchar(1000) DEFAULT NULL COMMENT '文章原始URL',
  `ARTICLE_ACT_DATE` varchar(20) DEFAULT NULL COMMENT '文章发布时间',
  `ARTICLE_ABSTRACT` varchar(1000) DEFAULT NULL COMMENT '文章摘要',
  `ARTICLE_SOURCE` varchar(200) DEFAULT NULL COMMENT '文章来源',
  `ARTICLE_SOURCE_SIGN` decimal(15,0) DEFAULT NULL COMMENT '文章来源级别',
  `MAIN_URL` varchar(200) DEFAULT NULL COMMENT '首图URL',
  `VIDEO_URL` varchar(200) DEFAULT NULL COMMENT '文章视频URL',
  `VIDEO_IMAGE_URL` varchar(200) DEFAULT NULL COMMENT '文章视频截图URL',
  `VISTINUM` decimal(15,0) DEFAULT NULL COMMENT '访问次数',
  `DOTOP` decimal(1,0) DEFAULT NULL COMMENT '置顶标识',
  `ITEM_NO` decimal(15,0) DEFAULT NULL COMMENT '所属栏目',
  `FLOW_SIGN` decimal(15,0) DEFAULT NULL COMMENT '0：未选取；1：已选取',
  `SOURCE` decimal(5,0) NOT NULL COMMENT '0:通过管道；1：自行添加  默认为：0',
  `NET_SIGN` varchar(50) DEFAULT NULL COMMENT '官网栏目标识',
  `PIPE_SING` varchar(50) DEFAULT NULL COMMENT '管网栏目标识',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='内容信息表';

